Serves_4:
{
    "recipeSource": "My Kitchen",
    "lastUpdated": "2021-09-15",
    "instructions": [
        {
            "stepNumber": 1,
            "stageTitle": "Preparation",
            "stepType": "prep",
            "instruction": "Wash and soak 2 cups of basmati rice in water for 30 minutes. Chop 2 onions, 2 tomatoes, 1 carrot, 1 capsicum, and 1 potato. Grind 1 cup of mint leaves and 1 cup of coriander leaves into a paste. Soak 1 cup of soya chunks in hot water for 10 minutes. Drain and squeeze out the water.",
            "time": 30,
            "tool": "Bowl, knife, blender, strainer"
        },
        {
            "stepNumber": 2,
            "stageTitle": "Cooking",
            "stepType": "cook",
            "instruction": "Heat 2 tablespoons of oil in a pressure cooker. Add 2 bay leaves, 4 cloves, 4 cardamom pods, and 1 cinnamon stick. Saute for a minute. Add the chopped onions and fry until golden brown. Add the chopped tomatoes and fry until they turn mushy. Add the chopped vegetables and fry for 2-3 minutes. Add the soya chunks and fry for another minute. Add the mint-coriander paste and fry for a minute. Add 2 teaspoons of biryani masala, 1 teaspoon of red chili powder, and salt to taste. Mix well. Drain the soaked rice and add it to the pressure cooker. Add 4 cups of water. Mix well. Close the lid and pressure cook for 2 whistles on high flame. Reduce the flame to low and cook for another 5 minutes. Turn off the flame and let the pressure release naturally.",
            "time": 40,
            "tool": "Pressure cooker, spatula"
        },
        {
            "stepNumber": 3,
            "stageTitle": "Serving",
            "stepType": "serve",
            "instruction": "Open the pressure cooker lid and fluff the rice gently with a fork. Garnish with fried onions and chopped coriander leaves. Serve hot with raita and papad.",
            "time": 5,
            "tool": "Fork, serving bowl"
        }
    ]
}

