    "instructions": [
        {
            "stepNumber": 1,
            "stageTitle": "Preparation",
            "stepType": "prep",
            "instruction": "Bring a large pot of salted water to a boil. Meanwhile, cut 2 boneless, skinless chicken breasts into bite-sized pieces. Season with salt and pepper. Finely chop 2 cloves of garlic and 1/4 cup of fresh parsley. Grate 1/2 cup of Parmesan cheese.",
