            "tool": "large pot, knife, cutting board, grater"
        },
        {
            "stepNumber": 2,
            "stageTitle": "Cooking",
            "stepType": "cook",
            "instruction": "Add 8 oz of pasta to the boiling water and cook according to package instructions until al dente. Drain and set aside. In a large skillet, heat 2 tbsp of olive oil over medium-high heat. Add the chicken and cook until browned and cooked through, about 5-7 minutes. Add the garlic and cook for another minute. Add 1/2 cup of chicken broth and bring to a simmer. Add the cooked pasta, parsley, and Parmesan cheese. Toss to combine and cook for another minute until the sauce has thickened slightly.",
            "time": 20,
            "tool": "large skillet, spatula"
        },
        {
            "stepNumber": 3,
            "stageTitle": "Serving",
            "stepType": "serve",
            "instruction": "Divide the pasta among 3 plates and serve hot.",
            "time": 0,
            "tool": "plates"
        }
    ]
}

