            "instruction": "Heat 1/4 inch of vegetable oil in a frying pan over medium-high heat. Once the oil is hot, drop spoonfuls of the lobster mixture into the pan and flatten them slightly with a spatula. Cook for 2-3 minutes on each side, until golden brown. Remove from the pan and place on a paper towel-lined plate to drain excess oil.",
